import React from 'react';
import Pokemon from './pokemon';

const Home = () => {
    const [state, setState] = React.useState(false);
    const [state2, setState2] = React.useState(false);

    return(
        <div>
            <h2>Pokedex</h2>
            <nav>
                <ul>
                    <li><button onClick={() => setState(!state)}>Pokemon List</button></li>
                    <li><button onClick={() => setState(!state)}>About</button></li>
                </ul>
            </nav>
            {state && <Pokemon />}
            {state && <p>This is a pokedex app made on React JS</p>}
        </div>
    )
}

export default Home;
